import React, {Component} from 'react';
import Spinner from "react-bootstrap/Spinner";

class FightResult extends Component {
    constructor(props) {
        super(props);
        this.state = {
            isLoading: true,
        }
    }

    render() {
        if (!this.state.isLoading) {
            return (
                <div>

                </div>
            );
        } else {
            return (
                <Spinner
                    className='loading-spinner'
                    animation="border"
                    variant="primary"
                />
            );
        }
    }
}

export default FightResult;
